    <div>

<h1>Welcome to LET'S CHAT</h1>

      <Router>

      <Routes>
      {/* Public routes */}
      <Route path="/login" element={<Login />} />
      <Route path="/register" element={<Register />} />

      {/* Private route */}

      {isAuthenticated &&   <Route path="/chat" element={<Chat />} />}


        {/* Add more routes as needed */}
        {/* <Route path="/" exact>
        </Route> */}
      </Routes>
    </Router>
    </div>
  );
}

export default App;
